import Header from '../components/Header';
import { Component } from "react";

export default class About extends Component {

    constructor(props) {
        super(props);
        this.state = {
            someVal: [1, 2, 4, 5]
        }

    }

    calculate = () => {
        let smallInt;

        let chkMax = Math.max(this.state.someVal)
        console.log("Chk max = ", chkMax)

    }

    render() {
        return (

            <div>
                <Header />
                <Layout >

                    {this.calculate}

                    About Project release management!
            </Layout>


            </div>
        )
    }

}
